import React, { Component } from 'react';

class SlideItem extends Component {
    render() {
        var {slide} = this.props;
        return (
            <div className="slider-item">
                <img
                    src={slide.imageXL}
                    alt=""
                    className=" d-none d-lg-block"
                />
                <img src="https://www.aorus.com/image/banner/Outriders-bundle-1620192485.jpg" alt="" className="d-block d-lg-none" />
                <div className="caption-center text-center">
                    <h2>GEAR UP WITH AORUS</h2>
                    <p>BUY an AORUS MONITOR OR MOTHERBOARD, GET OUTRIDERS FOR FREE*</p>
                    <button className="btn caption-btn rounded-0 shadow-none">
                        SEE MORE
                    </button>
                </div>
            </div>
        );
    }
}

export default SlideItem;
